import React from "react";
import movie_vegas from  "./movie_vegas.css"
import search_glass from "./search_glass.png"
import ReactDom from "react-dom";

class View  extends  React.Component{



    /**
     * model for Movie-vegas
     * declare class variables/attributes as private (local var and Accessor as a object literal);
     * @type {Object}
     */


       constructor(){
           super();
           this.state={

               printMovieVegasDetails:function(rating, likes, goodMovie, badMovie, result, favourites, movieList, watchLater) {


                   return(

                       <form encType="">

                             <MenuBar/>


                           <div id='scroll_list'>
                               <table>
                                   <tbody>
                                   <tr id="objects_entry_point">

                                       <td className="objects_entry_point">
                                           <div id="items">{rating}</div>
                                       </td>


                                   </tr>
                                   </tbody>
                               </table>

                           </div>
                           <footer id="footer"> Dan Technologies Â© Inc {new Date().getFullYear()} </footer>
                       </form>)

               }

              }


              }


                render() {
                    return this.state.printMovieVegasDetails();
                }


}

class MenuBar extends React.Component{

    render() {
        return (<div>


            <div id="heading_background">

            <SearchBar/>
                <MenuBar/>

            </div>

        </div>);
    }

}
class SearchBar extends React.Component{

    render() {
        return (<div id="search_box">
            <div className="search_box" placeholder="Search...">
                <input type="search" id="search_text_field"/>
                <img id='search_glass' src={search_glass} alt="search"/>
            </div>
        </div>);
    }

}
class Menu extends React.Component{

    render() {
        return (  <div id="menus">
                <span id="accents">=</span>
            </div>
        );
    }
}
class MenuItems extends React.Component{

    render() {
        return (<div id="menus_list">
            <span className="header">Favorites</span>
            <span className="header">Lists</span>
            <span className="header">Watch Later</span>
            <span className="header">Likes</span>
        </div>);
    }
}
class Request extends React.Component{

    render() {
        return super.render();
    }
}
class Respond extends React.Component{

    render() {
        return super.render();
    }
}


export  default View;
